import Header from './components/Header';
import Footer from './components/Footer';
import Button from './components/Button';
import { useEffect, useState } from 'react';
import Tasklist from './components/Tasklist';

function App() {
  const [tasks, setTasks] = useState([]);
  const [newTask, setNewTask] = useState('');
  const [welcomeMessage, setWelcomeMessage] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // ðŸ§  Fetch tasks from the backend
  const fetchTasks = async () => {
    const token = localStorage.getItem('token');
    const res = await fetch('http://localhost:5000/api/tasks', {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    if (!res.ok) throw new Error('Failed to fetch tasks');
    return res.json();
  };

  const createTask = async (text) => {
    const token = localStorage.getItem('token');
    const res = await fetch('http://localhost:5000/api/tasks', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        Authorization: `Bearer ${token}`,
      },
      body: JSON.stringify({ title: text }), // âœ… Changed this line
    });
    if (!res.ok) throw new Error('Failed to add task');
    return res.json();
  };

  const removeTask = async (id) => {
    const token = localStorage.getItem('token');
    const res = await fetch(`http://localhost:5000/api/tasks/${id}`, {
      method: 'DELETE',
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
    if (!res.ok) throw new Error('Failed to delete task');
  };

  useEffect(() => {
    const initializeApp = async () => {
      try {
        const data = await fetchTasks();
        setTasks(data);
        setWelcomeMessage('Welcome to the Task Tracker App!');
        const timer = setTimeout(() => setWelcomeMessage(''), 3000);
        return () => clearTimeout(timer);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    // Handle token from Google redirect
    const params = new URLSearchParams(window.location.search);
    const token = params.get('token');
    if (token) {
      localStorage.setItem('token', token);
      window.history.replaceState({}, document.title, '/'); // Clean URL
    }

    initializeApp();
  }, []);

  // âœ… Create Task
  const handleAddTask = async () => {
    if (!newTask.trim()) return;

    try {
      const createdTask = await createTask(newTask);
      setTasks([...tasks, createdTask]);
      setNewTask('');
    } catch (err) {
      alert('Error creating task: ' + err.message);
    }
  };

  // âœ… Delete Task
  const deleteTask = async (id) => {
    const task = tasks.find((t) => t._id === id);
    if (!task?.completed) return alert('Complete the task before deleting.');

    try {
      await removeTask(id);
      setTasks(tasks.filter((task) => task._id !== id));
    } catch (err) {
      alert('Error deleting task: ' + err.message);
    }
  };

  // âœ… Toggle Completion (Frontend only)
  const ToggleComplete = (id) => {
    setTasks(
      tasks.map((task) =>
        task._id === id ? { ...task, completed: !task.completed } : task
      )
    );
  };

  if (loading) return <div className="p-4">Loading tasks...</div>;
  if (error) return <div className="p-4 text-red-500">Error: {error}</div>;

  return (
    <div className="min-h-screen flex flex-col">
      <Header />
      <main className="container mx-auto my-8 flex-grow p-4">
        {welcomeMessage && (
          <div className="bg-blue-100 border-2 border-blue-500 text-blue-700 p-4 mb-4 rounded">
            <p>{welcomeMessage}</p>
          </div>
        )}

        <h2 className="text-2xl mb-4">Dashboard</h2>

        <div className="mb-6 flex gap-2">
          <input
            type="text"
            value={newTask}
            onChange={(e) => setNewTask(e.target.value)}
            placeholder="Enter a new task"
            className="flex-grow p-2 border rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
          <Button type="add" onClick={handleAddTask} />
        </div>

        <Tasklist
          tasks={tasks}
          onDelete={deleteTask}
          onToggleComplete={ToggleComplete}
        />
      </main>
      <Footer />
    </div>
  );
}

export default App;
